<li>项目启动，应用程序完成数据库连接池的建立后，Flyway自动运行。</li>
<li>初次使用时，Flyway会创建一个<code>flyway_schema_history</code>表，用于记录sql执行记录。</li>
<li>Flyway会扫描项目指定路径下(默认是<code>classpath:db/migration</code>)的所有sql脚本，与<code>flyway_schema_history</code>表脚本记录进行比对。<strong>根据脚本的名称提取版本号来比对</strong></li>
